import Button from 'react-bootstrap/Button';
import ButtonGroup from 'react-bootstrap/ButtonGroup';


function buttons(props){
    const {page} =props
    return ( 
        <div>
        <Button  variant="danger" onClick={props.prevhandle}>prev</Button>
        <h3> {page}</h3>
        <Button  variant="danger" onClick={props.nexthandle}>next</Button>
        </div>
         )
}

export default buttons
